	  207565,"1",11774,178,1943,
	  "0.10 USD",68.000,"bi-monthly","Indicia: \"JINGLE JANGLE COMICS No. 1. 1942. Published bi-monthly and copyright by Famous Funnies Inc. Fifth Ave. New York N.Y. ...\". Front page clearly states \"February\".Indicia information might indicate a cover date of February 1942 but most credible date nonetheless is February 1943 meaning that the book was issued late 1942 with a return date in February 1943.Several of the books advertised within (eg. Famous Funnies #'s 100 and 101 Skyman #2 and Heroic Comics #16) were issued late '42 or early '43 indicating that this book indeed was published late '42 or early '43.",
	  NULL,NULL,NULL,NULL,NULL,NULL
